Cast: Brooke Haven, Lyla Storm, Priya Anjali Rai, Brianna Blair, Dyana Vendetta

Sometimes being bad fells so good. At &quot;My Wife's Hot Friend&quot;, husbands do what they shouldn't - cheat on their wives. In this Naughty America original, the women are beautiful, open-minded, and thrilled to have a married man break his vows. Together, these couples set aside convention and make fantasy a naughty reality.
